isLongText:
{'longTextContent': '关于外国人永居门槛的话题，这几天讨论的比较热烈，争议比较大，刀锋也凑热闹简单说几点自己的想法。  

1、要保证吸引到高精尖的人才。美国为什么一直这么强大？就是吸引了全球最优秀的人才为他们效力，远一些的有二战时期的爱因斯坦，近一些的有微软CEO纳德拉。单从中国角度，每年多少优秀的中国留学生去美国读大学呢？清华北大的毕业生，有多大比例留在了美国？    
申请美国绿卡，必须足够优秀才行；中国绿卡，也需要保证含金量，比如在芯片，人工智能，发动机等领域很专业，能为中国经济发展做贡献的。     2、欧洲的教训很深刻。法国，曾经是100%的白人国家，然而，现在其人种的构成，却变成非洲黑人+黑白混血儿占法国总人口的60%。     3、如果一定要降低门槛，建议优先引进外国年轻单身女性，解决一下中国性别失衡问题。计划生育这么多年，总人口中男生比女生多了3000多万，这么多人打光棍，危及社会稳定。这个问题正好可以通过移民来解决，据说越南，乌克兰这些国家，女生过剩。      4、降低中国绿卡门槛之前，应优先放开计划生育。直接引用任泽平的一句话：为什么不能在大规模引进外国人之前先放开国内的生育呢？我们自己生的孩子就不优秀吗？这难道不是更重要、更紧迫？    5、谨防某些人趁机钻空子，享受高人一等的超国民待遇，鱼和熊掌兼得。比如移民海外的华人，因此变相拥有了双重国籍，两边的福利都要沾光，还能合法转移财产……这个口子坚决不能开啊！', 'url_objects': []}

{'longTextContent': '疫情蔓延 微软允许旧金山和西雅图员工在家办公：

这家软件巨头已经更新了员工守则，允许任何在西雅图或旧金山的员工在3月9日前在家办公 , 微软企业战略主管库尔特・德尔本(Kurt DelBene)表示，在微软的中国办事处，员工可选择在家办公，目前“很大比例”的员工正选择这么做 , 微软还要求在韩国的员工远程办公，虽然其新加坡的办公室是开放的，但员工也被要求在家办公。

