{'longTextContent': '国外网友 throwaway03052020 近日爆料称，微软或将会参加 AMD 在当地时间3月5日召开的财务分析日会议。

届时两家公司将会公布若干双方的合作成果，如 AMD 的硬件级 DXR 光线追踪支持（效率比 NVIDIA 的 RTX 高30%至50%）、专为微软及高端 Radeon GPU 开发的 RDNA2 架构等。另外还将公布一些游戏新作，其中包括一款 Turn 10 工作室的赛车游戏，并会展示 RDNA2 的光线追踪性能。云游戏领域的技术进步也将被提及。

另外 AMD 可能还会推出三款基于 RDNA2 的新 GPU，其中最高端产品的算力将超 18TFLOPS，售价999美元。', 'url_objects': []}

