mblog_show_union_info:
{'longTextContent': '标普500指数的11个类股周一全部上涨超过2%。FactSet的数据显示，苹果公司和微软股价飙升，当天这两家公司的总市值增加了1930亿美元。

“我们可以对经济衰退不以为然，但如果它开始影响到企业的偿债能力，那就会产生更深层次的问题。但在我看来，各国央行正在联手寻找一种方法，使信贷市场免受经济不确定性的影响，”Cresset Wealth Advisors投资长Jack Ablin表示。

美国股市交投异常活跃，成交量为140亿股，而过去20天的平均成交量为95亿股。纽约证交所跌涨股家数比为4.32:1；纳斯达克市场为2.69:1。而在美股报复性反弹的同时，恐慌指数VIX创2018年2月以来最大降幅。', 'url_objects': []}

