{'longTextContent': '喜欢迷彩和透明手柄的玩家又有新目标了。微软的半透明系列 Xbox One 手柄继“幻影黑”和“幻影白”之后，迎来了最新成员“幻影洋红特别版”，同时迷彩系列也有了新款“北极迷彩”。

 “幻影洋红”的渐变洋红配色散发出高贵典雅的氛围，透明部分机身在浅色衬托下显得灵动有活力。  “北极迷彩”除了白灰迷彩图案外，你会发现部分迷彩图案是透明的。微软在这些透明的部分区域使用了磨砂透明树脂，使其从里到外都是伪装迷彩的感觉，十分拉风。

 “幻影洋红特别版”Xbox One 手柄将于 2020 年 3 月 17 日发售，售价 69.99 美元。底座售价 49.99 美元。即日起在微软官方商城开启预定，国行版信息待日后更新。而“北极迷彩”目前只宣布会于 2020 年 5 月登陆美国的微软旗舰店和沃尔玛商场，售价和其他地区的发售信息有待官方日后公布。#VG新闻#', 'url_objects': [{'url_ori': 'VG新闻', 'object_id': '1022:2315229e2599eb86189b1c63b643ed06569ebe', 'object': {'object_id': '1022:2315229e2599eb86189b1c63b643ed06569ebe', 'containerid': '2315229e2599eb86189b1c63b643ed06569ebe', 'object_domain_id': '1022', 'object_type': 'search_topic', 'safe_status': 1, 'show_status': '11', 'act_status': '00', 'last_modified': 'Fri Oct 25 10:42:12 CST 2019', 'timestamp': 1571971332305, 'uuid': 4213155721919087, 'uuidstr': '4213155721919087', 'activate_status': '0', 'object': {'summary': '', 'create_at': '1429957126', 'image': {'url': 'https://wx3.sinaimg.cn/thumb180/70eb479bly1g8a8zvtp18j2050050abi.jpg'}, 'attribute': '1', 'url': 'https://s.weibo.com/weibo?q=%23VG%E6%96%B0%E9%97%BB%23', 'object_type': 'search_topic', 'id': '1022:2315229e2599eb86189b1c63b643ed06569ebe', 'display_name': 'VG新闻', 'short_url': 'http://t.cn/RAHoOSk', 'presenter_status': '1', 'tid': '2282685', 'target_url': 'https://s.weibo.com/weibo?q=%23VG%E6%96%B0%E9%97%BB%23', 'mobile': {'url': {'name': 'VG新闻', 'status': '1', 'scheme': 'sinaweibo://searchall?containerid=231522&q=%23VG%E6%96%B0%E9%97%BB%23'}, 'page_id': '2315229e2599eb86189b1c63b643ed06569ebe'}, 'biz': {'biz_id': '231522', 'containerid': '2315229e2599eb86189b1c63b643ed06569ebe'}, 'modify_type': 2, 'action': ['topic_status']}, 'actions': [{'name': '发博', 'pic': 'https://n.sinaimg.cn/photo/5b5e52aa/20170614/topic_post_weibo.png', 'type': 'link', 'params': {'scheme': 'sinaweibo://sendweibo?title=参与话题&content=#VG新闻#&need_follow=1&extparam=topicfb_fr%3awbcard'}}]}, 'like_count': 0, 'isActionType': True, 'follower_count': 0, 'asso_like_count': 0, 'card_info_un_integrity': False, 'super_topic_status_count': 0, 'super_topic_photo_count': 0, 'search_topic_count': 0, 'search_topic_read_count': 261206830, 'is_follow_object': False}]}

{'longTextContent': '微软Cortana正在放弃消费者功能，将重点转向企业用户：

随着新版本Windows 10的即将到来，它将于今年春天发布，微软的Cortana数字助理将会失去一些跟音乐和联网家庭相关的消费者技能以及一些第三方技能，当然这还只是开始，接下来Cortana跟普通用户的联系会越来越少，以至于最终淡出大家的视线 , 微软去年就有所解释，现在主要考虑的是为企业用户提供Cortana服务 , 也确实如此，新的Cortana体验都是关于Microsoft 365订阅服务，该服务包括访问办公工具、电子邮件、在线存储，所以对于这款电子助理的新功能将为用户提供日历、Microsoft To Do Notes等功能这件事情并不令人感到奇怪。

