{'longTextContent': '#下巴修复# 投稿：姐妹以前下巴做过一次假体，但是后来有些歪 ，再加上形态不好看，总觉得太厚重了，显得脸大，所以才想着二次改善。 

这次术后自己也倍加小心的照顾自己，就怕哪里在出错了，吃的食物稍微软一些，反正不用力就对了； 

