{'longTextContent': '【IDC云计算市场报告：阿里云全球前三，增速超亚马逊微软】从市场研究机构IDC获悉，近日，阿里云全球市场份额进一步上涨，紧随亚马逊、微软，增速为市场前五中最快。自2017年来，全球云计算市场形成3A格局（亚马逊AWS、微软Azure和阿里云），市场逐步向头部聚集，目前3A占据市场近七成份额。

历史数据显示，过去6年阿里云全球市场份额迅速增长，成为全球第三大云计算服务商。期间，亚马逊、微软、阿里云市场份额不断攀升，IBM逐年下滑，谷歌从2016年上榜后，逐渐上升至第五。

同时，3A阵营的增速持续领跑市场，其中阿里云增速最快，而全球前五名之外的云服务商大多跑输大盘，落后于整体行业增长。因此，市场份额不断向头部云服务商聚集，截止2019年6月，3A占据市场近七成份额。http://t.cn/A67SReVm', 'url_objects': [{'url_ori': 'http://t.cn/A67SReVm', 'object_id': '3000000094:15709cb9cbb4e861760846a310772824', 'info': {'url_short': 'http://t.cn/A67SReVm', 'url_long': 'http://www.forbeschina.com/technology/47394', 'type': 39, 'result': True, 'title': '', 'description': '', 'last_modified': 1583148161, 'transcode': 0, 'ext_status': 0}, 'object': {'object_id': '3000000094:15709cb9cbb4e861760846a310772824', 'containerid': '', 'object_domain_id': '3000000094', 'object_type': 'webpage', 'safe_status': 1, 'show_status': '00', 'act_status': '99', 'last_modified': 'Mon Mar 02 19:22:41 CST 2020', 'timestamp': 1583148161811, 'uuid': 4478110316626803, 'uuidstr': '4478110316626803', 'activate_status': '0', 'object': {'summary': ' 从市场研究机构IDC获悉，近日，阿里云全球市场份额进一步上涨，紧随亚马逊、微软，增速为市场前五中最快。自2017...', 'image': {'url': 'http://img.t.sinajs.cn/t6/style/images/face/face_card_longwb.png'}, 'url_short': 'http://t.cn/A67SReVm', 'keywords': '', 'area_class': '', 'object_type': 'webpage', 'description': '', 'generator': 'tc.service.weibo.com', 'effect_url': 'http://www.forbeschina.com/technology/47394', 'image_origin': {'url': 'http://forbes-web.oss-cn-hongkong.aliyuncs.com/user-443/202003021527201.jpg?x-oss-process=image/watermark,image_Y29weV8yMDE5LnBuZz94LW9zcy1wcm9jZXNzPWltYWdlL3Jlc2l6ZSxQXzIw,x_10,y_10'}, 'display_name': 'IDC云计算市场报告：阿里云全球前三，增速超亚马逊微软', 'priority': 10, 'imglist': False, 'url': 'http://www.forbeschina.com/technology/47394', 'score': '', 'from': 'firehose', 'isMobile': False, 'id': '3000000094:15709cb9cbb4e861760846a310772824', 'class_level2': '', 'class_level1': '', 'ge': True, 'md5': '', 'biz': {'biz_id': '', 'containerid': ''}, 'target_url': 'http://www.forbeschina.com/technology/47394'}}, 'like_count': 0, 'isActionType': False, 'follower_count': 0, 'asso_like_count': 0, 'card_info_un_integrity': False, 'super_topic_status_count': 0, 'super_topic_photo_c