{'longTextContent': '#杰克韦尔奇去世#今晚最大的噩耗，难过，一代金融管理大师走了，一路走好。

在他领导集团的20年里，公司市值从120亿美元增长到4100亿美元，该公司市值从120亿美元增至4100亿美元。在韦尔奇的领导下，通用电气成为全球市值最高的公司，仅次于微软。

在掌舵期间，韦尔奇买卖了许多企业，将这个工业巨头扩展到金融服务和咨询领域。通用金融银行在他任职7年后成立。他的收购对象包括美国广播公司（NBC）当时的所有者RCA，以及卷入内幕交易丑闻的券商基德尔-皮博迪（KidderPeabody）。', 'url_objects': [{'url_ori': '杰克韦尔奇去世', 'object_id': '1022:2315222806f36d4a5821ebcafb649bd9643867', 'object': {'object_id': '1022:2315222806f36d4a5821ebcafb649bd9643867', 'containerid': '2315222806f36d4a5821ebcafb649bd9643867', 'object_domain_id': '1022', 'object_type': 'search_topic', 'safe_status': 1, 'show_status': '11', 'act_status': '00', 'last_modified': 'Mon Mar 02 22:50:26 CST 2020', 'timestamp': 1583160626043, 'uuid': 4478143971721375, 'uuidstr': '4478143971721375', 'activate_status': '0', 'object': {'id': '1022:2315222806f36d4a5821ebcafb649bd9643867', 'display_name': '杰克韦尔奇去世', 'url': 'https://s.weibo.com/weibo?q=%23%E6%9D%B0%E5%85%8B%E9%9F%A6%E5%B0%94%E5%A5%87%E5%8E%BB%E4%B8%96%23', 'short_url': 'http://t.cn/A67oGKiw', 'object_type': 'search_topic', 'summary': '3月2日，通用电气前首席执行官和董事长杰克・韦尔奇去世，享年84岁。', 'attribute': '1', 'create_at': 1583156185, 'action': ['topic_status'], 'creator': {'uid': '1770995645', 'create_at': 1583156185, 'sid': '0'}, 'image': {'url': 'https://wx2.sinaimg.cn/large/7061c249ly1gcfx233i44j20dw0dw3ze.jpg'}, 'mobile': {'page_id': '2315222806f36d4a5821ebcafb649bd9643867', 'url': {'scheme': 'sinaweibo://searchall?containerid=231522&q=%23%E6%9D%B0%E5%85%8B%E9%9F%A6%E5%B0%94%E5%A5%87%E5%8E%BB%E4%B8%96%23&extparam=%23%E6%9D%B0%E5%85%8B%E9%9F%A6%E5%B0%94%E5%A5%87%E5%8E%BB%E4%B8%96%23', 'status': '1', 'name': '杰克韦尔奇去世'}, 'card': {'status': 0}}, 'biz': {'biz_id': '231522', 'containerid': '2315222806f36d4a5821ebcafb649bd9643867'}, 'target_url': 'https://s.weibo.com/weibo?q=%23%E6%9D%B0%E5%85%8B%E9%9F%A6%E5%B0%94%E5%A5%87%E5%8E%BB%E4%B8%96%23', 'modify_type': 5, 'topic_tag': '', 'location': '', 'category': '财经|7', 'cate_id': '7', 'ever_in_hotsearch': 1}, 'actions': [{'name': '发博', 'pic': 'https://n.sinaimg.cn/photo/5b5e52aa/20170614/topic_post_weibo.png', 'type': 'link', 'params': {'scheme': 'sinaweibo://sendweibo?title=参与话题&content=