{'longTextContent': '据市场研究机构IDC数据，阿里云全球市场份额进一步上涨，紧随亚马逊、微软，增速为市场前五中最快。自2017年来，全球云计算市场形成3A格局（亚马逊AWS、微软Azure和阿里云），市场逐步向头部聚集，目前3A占据市场近七成份额。

历史数据显示，过去6年阿里云全球市场份额迅速增长，成为全球第三大云计算服务商。期间，亚马逊、微软、阿里云市场份额不断攀升。

数据港：为客户提供完整的数据中心基础设施解决方案，是国内唯一一家同时服务于阿里巴巴、腾讯、百度和网易四大世界级互联网公司的数据中心运营商。', 'url_objects': []}

reward_scheme:
{'longTextContent': '【传微软升级Project x Cloud 可允许玩家串流PC游戏】微软正在不断地改进Project xCloud项目，看起来该服务未来将获得大力拓展，允许玩家能像GeForce Now那样可以串流PC游戏。

Project x Cloud可以让玩家通过Wifi或手机移动网络直接从云端串流到自己的安卓/苹果手机或平板电脑上，结合Xbox One手柄游玩，而不需要购买Xbox主机或游戏。

根据微软外媒编辑Brad Sams透露，微软目前正在开发串联PC的功能，目前暂无更多细节透露。', 'url_objects': []}

cardid:
{'longTextContent': '【推特用户曝光微软 Surface Duo 双屏手机「窥视」功能】
根据外媒 The Verge 的报道，一推特用户在其账号中通过渲染动画的形式展示了微软 Surface Duo 的一个交互功能「窥视」。该功能允许用户在半开合的状态下查看并且处理来电以及信息通知，以解决双屏手机不具备外屏无法快速处理消息的缺陷。

去年 10 月份微软发布 Surface Duo 双屏手机以及 Surface Neo 双屏电脑，但到目前为止关于这两台设备的曝光信息依然不多。The Verge 表示微软有望在今年 5 月份的 Build 开发者大会上公开展示这两款设备的所有信息。', 'url_objects': []}

