{'longTextContent': '【微软：季度营收或因疫情低于预期 Xbox业务不受影响】据外媒gamesindustry报道，微软称目前不太可能达到上月在财务报告中公布的季度营收预期，尽管Xbox似乎没有受到疫情的影响。该公司发表声明称，新型冠状病毒的爆发导致了生产中断，而PC业务将无法达到他们的预期。

早在今年1月份，微软在公布第二季度财务报表时，他们预测该部分的收入将在107.5亿美元到111.5亿美元之间，这样的浮动区间超出了正常的水准，因为他们认为这种不稳定性是中国疫情形势所导致的。尽管Windows OEM和Surface产品的需求依然强劲，但微软表示，其供应链恢复运营的速度“低于预期”。

不过微软强调称，其所预测的第三季度其他部分营收都没有发生变化，这表明Xbox业务所受到的负面影响没有那么大。微软表示，员工、客户以及合作伙伴的健康安全仍是公司所最为重视的，公司正与当地和全球卫生局合作并提供援助和捐款。外媒gamesindustry称，最近业界有声音表示，新冠病毒对中国和亚洲其他地区制造渠道产生的影响，会波及到次世代主机XSX的计划，但这一观点也只是人们的猜测而已，仅供参考。', 'url_objects': []}

product_struct:
{'longTextContent': '受新冠病毒疫情影响，微软退出旧金山游戏开发者大会：

据外媒报道，微软公司表示，由于担心冠状病毒的传播，该公司将退出定于下个月在旧金山举行的游戏开发者大会。本届的游戏开发者大会定于3月16日至3月20日举行，对于开发和设计游戏的工程师和艺术家来说，这是一个非常重要的一年一度的活动。微软表示，虽然退出了本次活动，但是他们将以线上直播的方式展示其原本定于在大会上展示的内容。（新浪科技）

