number_display_strategy:
{'longTextContent': '今年最期待的产品之一是PlayStation 5，索尼官方至今还没有透露出任何机能数据，社媒上也只是有几张工程机的谍照。

不过隔壁微软已经开出了大招，新一代主机Xbox Series X拥有更好的SSD，支持最高120帧（提醒你该换电视了），最香的是它向下兼容Xbox One的所有游戏。

另外支持Smart delivery ，就是说用户只需要购买一次游戏就可以同时拥有Xbox One和X上的不同版本，这对老用户来讲相当友好。目前赛博朋克2077已经迫不及待表示支持，“我们不认为玩家应该为同一份游戏花两次钱。”', 'url_objects': []}

